import React from "react";
import Link from "next/link";

const Index = () => {
  return (
    <div>
      <h1>Welcome to SW4T</h1>
      <Link href="/about" title="About Page">
        Learn more about SW4T
      </Link>
    </div>
  );
};

export default Index;
